FeedPackage.Description:
Usage:
/* An INI file content : ;Comment [Section] key=value */
var iniFile = new Ini(filePath); // Initialize a ini file. if the file exists, it is loaded automatically, otherwise it will be an empty ini file that will be written in.
// Read ini // If the key does not exists, an empty string is returned. // Keys and sections are case insensitives string[] keys = iniFile.GetKeys("section"); // Get all the sections of the ini file string[] sections = iniFile.GetSections(); // Get all the keys names in a section var s = iniFile.GetValue("key"); // Get a key value out of a section var s = iniFile.GetValue("key", "section"); // Get a key value in a section var s = iniFile.GetValue("key", "section", "default value"); // Get a key value or a default value Load(); // Reloads a ini file
// Write ini // Keys and sections are case insensitives iniFile.WriteValue("key", "value"); // Add or update a key value out of a section iniFile.WriteValue("key", "section", "value"); // Add or update a key value in a section Save(); // Save the modified ini file to the disk

FeedPackage.ReleaseNotes:
Internet Connection Speed API for Windows 10 UWP, Version 1.0

This is a convenient Windows multi-language API for making Internet connection state decisions in real time, using the speed result to decide if/when to run your network-intensive code. The same code works across all Windows 10 devices as this is implemented as a Universal Windows Runtime component.

API

namespace InetSpeedUWP

class InternetConnectionState

object that contains the static members you use to determine Internet connection state (connection status and speed/latency/delay)

Properties

static bool Connected  

Returns true if the current Internet connection for the device is active, else false.

static double RawSpeed

Computed speed, in seconds

Methods

static IAsyncOperation<ConnectionSpeed> GetInternetConnectionSpeed();

Asynchronous method that will return a ConnectionSpeed (see below).

static IAsyncOperation<ConnectionSpeed> GetInternetConnectionSpeedWithHostName(HostName hostName);

Asynchronous method that will perform the speed/latency test on a supplied host target and returns a ConnectionSpeed. This is very useful to ensure the Internet resource you’re trying to reach is available at the speed level you require (generally, these would be High and Average…).

enum class  ConnectionSpeed

Speed test results are returned as an enum value (For JavaScript consumers, you’ll need to build your own object mapping. See the JavaScript example).

High: Device is currently attached to a high-speed, low-latency Internet connection.

Average: Device is currently attached to an average speed/latency Internet connection (LTE, 3G, etc…).

Low: Device is currently attached to a low-speed, high-latency Internet connection.

Unknown: The current Internet connection speed cannot be determined. Proceed carefully...

Example (C# consumer):

This example tests for a highspeed network based on a provided HostName (this is the best way to use this API given you really want to know the status of the Internet connection as it pertains to where you need to put/grab data over the network in real time...). Note you should always test for Unknown and then react accordingly (don't proceed with network work. Unknown means you are connected to the Internet, but you can't do network work with acceptable latency.)

High and Average are the two results you should test for before doing network work that involves either downloading or uploading data:

C#
    using InetSpeedUWP; 

            ... 

             if (InternetConnectionState.Connected)  
             {  
                 var speed =  
                     await InternetConnectionState.GetInternetConnectionSpeedWithHostName(new HostName("targethost.com"));  

                 if (speed == ConnectionSpeed.High)  
                 {  
                     \\Current network speed is High, low latency  
                 }  
                 else if (speed == ConnectionSpeed.Average)  
                 {  
                     \\Current network speed is Average, average latency  
                 }  
                 else if (speed == ConnectionSpeed.Low)  
                 {  
                     \\Current network speed is Low, high latency  
                 }  
                 else  
                 {  
                     \\Current Network Speed is Unknown - use at your own risk...  
                 }  
             }  
             else  
             {  
                 ResultsBox.Text = "Not Connected to the Internet!";  
             }  
         } 

Example (JavaScript consumer):

The JavaScript WinRT projection doesn't support C++ enum class named values. Instead, the enum integer values are passed along...

The following makes the code easier to read -> apply named values (JS objects) to numbers (the speed result integer) received from the native API...

  JavaScript
 var ConnectionSpeed = { High: 0, Average: 1, Low: 2, Unknown: 3 };  

   function getConnectionSpeed() {  
       if (InetSpeedUWP.InternetConnectionState.connected) {  
               InetSpeedUWP.InternetConnectionState.getInternetConnectionSpeedWithHostName(  
                 new Windows.Networking.HostName("mytargethost.com"))  
                 .then(function (speed) {  
                 if (speed === ConnectionSpeed.Unknown) return;  
                 if (speed === ConnectionSpeed.High) {  
                           //Highspeed, low latency Internet connection detected...  
                 }  
                 else if  (speed === ConnectionSpeed.Average){  
                           //Average speed, average latency Internet connection detected...  
                 }  
                 else if (speed ===  ConnectionSpeed.Low) {  
                           //High latency, low speed Internet connection detected...  
                 }  
           });  
       }  
       else {  
                 //Not connected...  
 } 

Example (C++/CX consumer):

  C++
  if (InternetConnectionState::Connected) 
    { 
        auto connectionSpeedWithHost = InternetConnectionState::GetInternetConnectionSpeedWithHostName(ref new Windows::Networking::HostName("pinterest.com")); 
        auto _speed = create_task(connectionSpeedWithHost); 
        _speed.then([this](ConnectionSpeed speed) 
        { 
            if (speed == ConnectionSpeed::Unknown) return; 
            TextBoxResults->Text += speed.ToString() + "\n" + "Raw Speed: " + InternetConnectionState::RawSpeed + "\n"; 
        }); 
    } 
    else 
    { 
        TextBoxResults->Text = "Not connected..."; 
    }

Optimizations, removal of non-public APIs from public view... Added support for Windows 8.0...

You will need to remove the architecture specific references that don’t apply to your project’s build target after referencing the nuget package via References -> Add Reference… -> Manage Nuget packages. The component is written in C++/CX, so each dll and winmd file is created for a specific machine architecture (ARM for Windows, Windows Phone 8 (ARM), Windows Phone 8.1 (ARM), Windows 8/8.1 (ARM, x86, x64).  

You’ll see these files in your references folder when you install the InetSpeedWinRT nuget package (remove all that don’t apply to your solution…) 

InetSpeedWinRTARM (For Windows RT (ARM) WinRT apps) InetSpeedWinRTPhone (For Windows Phone 8 Silverlight apps) InetSpeedWinRTPhone81 (For Windows Phone 8.1, SL and WinRT apps) 
InetSpeedWinRTx86 (Windows 8.1 WinRT apps, 32-bit Windows) InetSPeedWinRTx64 (Windows 8.1 WinRT apps, 64-bit Windows) 

Added in this release: InetSpeedWinRTWin8x86/x64/ARM for Windows 8 support.

Note: You will also need to reference the SDK Extension Microsoft Visual C++ 2013 Runtime Package for Windows 8.1 and Windows Phone 8.1 projects, for C# and JavaScript projects. 

The Internet Connection Speed API, version 1.1.0

Ctor

InternetConnectionState InternetConnectionState(); 

Properties: 

static bool Connected 
Returns true if the current Internet connection for the device is active, else false. 

Instance methods: 

IAsyncOperation<ConnectionSpeed> GetInternetConnectionSpeed();
Asynchronous method that will return a ConnectionSpeed (see below). 

IAsyncOperation<ConnectionSpeed> GetInternetConnectionSpeedWithHostName(HostName hostName); 
Asynchronous method that will perform the speed/latency test on a supplied host target and returns a ConnectionSpeed. This is very useful to ensure the Internet resource you’re trying to reach is available at the speed level you require (generally, these would be High and Average…). 

enum ConnectionSpeed:  

High: Device is currently attached to a high-speed, low-latency Internet connection. 

Average: Device is currently attached to an average speed/latency Internet connection (LTE, 3G, etc…). 

Low: Device is currently attached to a low-speed, high-latency Internet connection. 

Unknown: The current Internet connection speed can't be determined. Proceed with caution. This could mean that there is very high network latency, a problem with an upstream service, etc...

Example (C# consumer):
This example tests for a highspeed network. Note you should always test for Unknown and then react accordingly (don't proceed with network work.). High and Average are the two results you should test for before doing network transactions.

if(InternetConnectionState.Connected)
{
   var connectionState = new InternetConnectionState();
   var speed = await connectionState.GetInternetConnectionSpeed();
   if(speed == ConnectionSpeed.Unknown) return; //don't proceed with network work...
   if(speed == ConnectionSpeed.High){//do network work that requires highspeed/low latency connection...}
}
else {//not connected...}

Known issue with Windows Phone radio when the device resumes from standby

When Windows Phone devices resume from standby, the time it takes for the cellular radio to fully “awaken” can lead to inaccurate results from InetSpeedWinRT (the ConnectionSpeed result in this case is typically Low or Unknown – and this has been verified in extensive testing to be inaccurate as a subsequent call will return the actual state, typically higher…)… This is not a bug in InetSpeedWinRT. This is an issue faced by any app that makes network calls upon device then app resumption. 

One known workaround is to make a network call from both Application_Launching and Application_Activated event handlers (typically in your App class implementation file). By doing this before calling GetInternetConnectionSpeed or GetInternetConnectionSpeedWithHostname (or any API that generates network traffic on a cellular connection as part of its implementation) in your network-critical code paths, you can guarantee that the radio is fully functional and therefore an accurate result is returned. In our WP test app, we create an instance of InternetConnectionState and then call GetInternetConnectionSpeed in app activated and launching handlers: 

        // Code to execute when the application is launching (eg, from Start)
        // This code will not execute when the application is reactivated
        private async void Application_Launching( object sender, LaunchingEventArgs e )
        {
            //this is a workaround to deal with cellular radio wake up delay after WP devices resume from Standby...
            //by creating a test at this time, the user code that calls the API will be running on a warmed up radio…
            var connectionState = new InternetConnectionState();
            var speed = await connectionState.GetInternetConnectionSpeed();
        }

        // Code to execute when the application is activated (brought to foreground)
        // This code will not execute when the application is first launched
        private async void Application_Activated( object sender, ActivatedEventArgs e )
        {
            //this is a workaround to deal with cellular radio wake up delay after WP devices resume from Standby...
            //by creating a test at this time, the user code that calls the API will be running on a warmed up radio…
            var connectionState = new InternetConnectionState();
            var speed = await connectionState.GetInternetConnectionSpeed();
        }

Important considerations:

You’ll need to be careful when managing radio state in this way as keeping the radio awake eats battery (which is why it is put to sleep upon device standby…). There are other strategies to employee here that does not involve making network calls. For example, you can query the network interface the device is currently using to achieve the same results (NetworkInterface.NetworkInterfaceType) – see below... This has been tested for Silverlight WP apps. As always, experiment and measure to ensure you do not consume electrons unnecessarily! Regardless, you will need to employ a radio waking strategy to ensure the results you get from InetSpeedWinRT are accurate on WP devices resuming from standby. 

        // Code to execute when the application is launching (eg, from Start)
        // This code will not execute when the application is reactivated
        private void Application_Launching( object sender, LaunchingEventArgs e )
        {
            //This will wake up the radio...
            var networkInterfaceType = NetworkInterface.NetworkInterfaceType;
        }        

        // Code to execute when the application is activated (brought to foreground)
        // This code will not execute when the application is first launched
        private void Application_Activated( object sender, ActivatedEventArgs e )
        {
            //This will wake up the radio...
            var networkInterfaceType = NetworkInterface.NetworkInterfaceType;
        }


